import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import MenuBar from '../components/MenuBar';
import LoginForm from '../components/LoginForm'; // Import LoginForm component
import '../css/profile.css';
import '../css/index.css';
import defaultProfilePic from '../images/default-profile-pic.jpg';

const Profile = () => {
    const [username, setUsername] = useState('');
    const [videos, setVideos] = useState([]);
    const [isAuthenticated, setIsAuthenticated] = useState(true);

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            setIsAuthenticated(false); // User is not authenticated
            return;
        }

        const fetchProfileData = async () => {
            try {
                const res = await axios.get('http://localhost:5001/api/videos/user', {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });
                setUsername(res.data.username);
                setVideos(res.data.videos);
            } catch (error) {
                console.error('Error fetching profile data:', error);
                setIsAuthenticated(false); // User is not authenticated
            }
        };

        fetchProfileData();
    }, []);

    if (!isAuthenticated) {
        return <LoginForm />; // Render login page if not authenticated
    }

    return (
        <div className="profile">
            <div className="inner-profile-container">
                <div className="profile-header">
                    <div className="profile-image">
                        <img src={defaultProfilePic} className="profile-header-pic" alt="Profile" />
                    </div>
                    <h1>@{username}</h1>
                    <button className="logout-button" onClick={() => {
                        localStorage.removeItem('token');
                        setIsAuthenticated(false); // Log out and render login page
                    }}>
                        Log Out
                    </button>
                </div>
                <div className="video-grid">
                    {videos.map((video) => (
                        <div key={video.id} className="video-grid-item">
                            <img
                                src={`http://localhost:5001${video.thumbnail}`}
                                alt={video.title}
                                className="video-thumbnail"
                            />
                        </div>
                    ))}
                </div>
            </div>
            <MenuBar />
        </div>
    );
};

export default Profile;
